    public void onClick(android.content.DialogInterface arg0, int arg1) {
        android.text.format.Time now = new android.text.format.Time();
        now.setToNow();
        com.salerecord.pos.DailyRecord dr = new com.salerecord.pos.DailyRecord(com.rtt_ku.pos.Tab_Sale_Activity.this, now);
        com.rtt_ku.pos.Tab_Sale_Activity.sCT.confirmSale(basket, dr);
        com.rtt_ku.pos.Tab_Sale_Activity.sCT.setDB(myDb);
        com.rtt_ku.pos.Tab_Sale_Activity.sCT.updateInventory();
        productList = com.rtt_ku.pos.Tab_Sale_Activity.sCT.getProductList();
        adapter.notifyDataSetChanged();
        basket = com.rtt_ku.pos.Tab_Sale_Activity.sCT.newBasket();
        saleAdapter.notifyDataSetChanged();
        total_text.setText("0.0");
        cash.setText("");
    }
}).show()

